import React from 'react'
import { Image } from 'react-bootstrap';
import logo from '../context/cartContext'

const CartWidget = () => {
  return (
    <Image
        src={logo}
        width="30"
        height="30"
        className="d-inline-block align-top mt-0"
        alt="logo"
        />
  )
}

export default CartWidget
